CREATE DATABASE IF NOT EXISTS FOOSBALL;

DROP TABLE IF EXISTS FOOSBALL.RECORDS_WINS;
DROP TABLE IF EXISTS FOOSBALL.RECORDS_LOSSES;
DROP TABLE IF EXISTS FOOSBALL.PLAYERS_CATEGORIES;
DROP TABLE IF EXISTS FOOSBALL.GAMES;
DROP TABLE IF EXISTS FOOSBALL.PLAYERS;
DROP TABLE IF EXISTS FOOSBALL.CATEGORIES;

CREATE TABLE FOOSBALL.CATEGORIES (
	category_id SMALLINT NOT NULL,  
	category_name VARCHAR(255) NOT NULL,  
	PRIMARY KEY (category_id)
);

CREATE TABLE FOOSBALL.PLAYERS (
	player_id SMALLINT NOT NULL, 
	last_name VARCHAR(255) NOT NULL, 
	first_name VARCHAR(255) NOT NULL, 
	elo SMALLINT NOT NULL, 
	doubles_wins SMALLINT NOT NULL DEFAULT 0, 
	doubles_losses SMALLINT NOT NULL DEFAULT 0, 
	singles_wins SMALLINT NOT NULL DEFAULT 0,
	singles_losses SMALLINT NOT NULL DEFAULT 0,  
	prev_wins SMALLINT NOT NULL DEFAULT 0, 
	prev_losses SMALLINT NOT NULL DEFAULT 0, 
	PRIMARY KEY (player_id)
);

CREATE TABLE FOOSBALL.GAMES (
	game_id INT NOT NULL,  
	game_date DATE NOT NULL,  
	winner_1 SMALLINT NOT NULL, 
	winner_2 SMALLINT,  
	loser_1 SMALLINT NOT NULL, 
	loser_2 SMALLINT, 
	shutout BIT(1) DEFAULT 0, 
	PRIMARY KEY (game_id),
	INDEX (winner_1),
	INDEX (winner_2),
	INDEX (loser_1),
	INDEX (loser_2),
	FOREIGN KEY (winner_1) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (winner_2) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (loser_1) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (loser_2) REFERENCES FOOSBALL.PLAYERS (player_id)
);

CREATE TABLE FOOSBALL.PLAYERS_CATEGORIES (
	player_id SMALLINT NOT NULL, 
	category_id SMALLINT NOT NULL, 
	UNIQUE (player_id, category_id),
	INDEX (player_id),
	INDEX (category_id),
	FOREIGN KEY (player_id) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (category_id) REFERENCES FOOSBALL.CATEGORIES (category_id)
);

CREATE TABLE FOOSBALL.RECORDS_LOSSES (
	record_id BIGINT NOT NULL, 
	count SMALLINT NOT NULL DEFAULT 1, 
	player_1 SMALLINT NOT NULL, 
	player_2 SMALLINT, 
	start_date DATE NOT NULL, 
	end_date DATE, 
	PRIMARY KEY (record_id),
	INDEX (player_1),
	INDEX (player_2),
	FOREIGN KEY (player_1) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (player_2) REFERENCES FOOSBALL.PLAYERS (player_id)
);

CREATE TABLE FOOSBALL.RECORDS_WINS (
	record_id BIGINT NOT NULL, 
	count SMALLINT NOT NULL DEFAULT 1, 
	player_1 SMALLINT NOT NULL, 
	player_2 SMALLINT, 
	start_date DATE NOT NULL, 
	end_date DATE, 
	PRIMARY KEY (record_id),
	INDEX (player_1),
	INDEX (player_2),
	FOREIGN KEY (player_1) REFERENCES FOOSBALL.PLAYERS (player_id),
	FOREIGN KEY (player_2) REFERENCES FOOSBALL.PLAYERS (player_id)
);




